PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "schema_migrations" ("version" varchar NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "ar_internal_metadata" ("key" varchar NOT NULL PRIMARY KEY, "value" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "users" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "provider" varchar DEFAULT 'email' NOT NULL, "uid" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar, "reset_password_sent_at" datetime, "allow_password_change" boolean DEFAULT 0, "remember_created_at" datetime, "confirmation_token" varchar, "confirmed_at" datetime, "confirmation_sent_at" datetime, "unconfirmed_email" varchar, "name" varchar, "nickname" varchar, "image" varchar, "email" varchar, "tokens" json, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar, "last_sign_in_ip" varchar, "confirmation_otp" varchar);
CREATE TABLE IF NOT EXISTS "authentication_tokens" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "body" varchar, "user_id" integer NOT NULL, "last_used_at" datetime, "expires_in" integer, "ip_address" varchar, "user_agent" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, CONSTRAINT "fk_rails_ad331ebb27"
FOREIGN KEY ("user_id")
  REFERENCES "users" ("id")
);
CREATE TABLE IF NOT EXISTS "employee_details" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "first_name" varchar, "last_name" varchar, "city" varchar, "description" varchar, "email" varchar, "connection" varchar, "designation" varchar, "image" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "role_id" integer, "mobile_no" varchar, "company_detail_id" integer);
CREATE TABLE IF NOT EXISTS "roles" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "company_details" ("id" integer NOT NULL PRIMARY KEY, "name" varchar DEFAULT NULL, "tagline" varchar DEFAULT NULL, "description" varchar DEFAULT NULL, "city" varchar DEFAULT NULL, "followers" varchar DEFAULT NULL, "no_of_employees" integer DEFAULT NULL, "logo" varchar DEFAULT NULL, "founders_count" integer DEFAULT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "url" varchar DEFAULT NULL, "company_type" varchar DEFAULT NULL, "foundation_year" varchar DEFAULT NULL, "resync_progress" varchar DEFAULT NULL, "posts" varchar);
CREATE TABLE IF NOT EXISTS "lines" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "line_number" integer, "company_detail_id" integer, "completed" boolean, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "name" varchar);
CREATE TABLE IF NOT EXISTS "exception_details" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "company_detail_id" integer, "ex_status" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "rake_updates" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "status" varchar, "company_detail_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_uid_and_provider" ON "users" ("uid", "provider");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
CREATE UNIQUE INDEX "index_users_on_confirmation_token" ON "users" ("confirmation_token");
CREATE INDEX "index_authentication_tokens_on_user_id" ON "authentication_tokens" ("user_id");
CREATE INDEX "index_authentication_tokens_on_body" ON "authentication_tokens" ("body");
COMMIT;
